#define numMoles 7
struct Moles mole1;
struct Moles mole_arr[numMoles];
int show = 0;
int gameStatus = GAME_START_MENU;
volatile int *pixel_ctrl_ptr;
/********************************************************************************
 * Main program
 ********************************************************************************/
int main(void)
{
    pixel_ctrl_ptr = (int *)0xFF203020;

    // BACK BUFFER SET
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the back buffer

    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();

    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer

    /* set BACK pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer

    set_A9_IRQ_stack(); // initialize the stack pointer for IRQ mode
    config_GIC();       // configure the general interrupt controller
    config_KEYs();      // configure pushbutton KEYs to generate interrupts
    config_keyboard();
    enable_A9_interrupts(); // enable interrupts in the A9 processor
    write_instructions();
    clear_screen();

    while (1)
    {
        // start menu
        clearScreenVsync(3);

        while (gameStatus == GAME_START_MENU)
        {
            for (i = 0; i < 34; i++)
            {
                for (j = 0; j < 150; j++)
                {
                    plot_pixel(j + 80, i + 80, startText[i][j]);
                }
            }

            wait_for_vsync();                           // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
        }

        config_interval_timer(TIMER_ON);

        clearScreenVsync(3);

        for (i = 0; i < numMoles; i++)
        {
            mole_arr[i].x_loc = (rand() % (100)) + 40;
            mole_arr[i].y_loc = (rand() % (100)) + 40;
            mole_arr[i].x_prev_loc = mole_arr[i].x_loc;
            mole_arr[i].y_prev_loc = mole_arr[i].y_loc;
            mole_arr[i].direction_y = ((rand() % 2) * 2) - 1; 
            mole_arr[i].direction_x = ((rand() % 2) * 2) - 1;
            mole_arr[i].displayed = rand() % 2;
        }
        update_score();

        wait_for_vsync();                           // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
        wait_for_vsync();                           
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);

        while (gameStatus == GAME_RUNNING)
        {
            show = 1;
            srand(time(0)); // ensuring random numbers
            update_screen();

            if (gameCounter == 3) // can adjust
                gameStatus = GAME_OVER;

            wait_for_vsync();                           // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
        }

        gameCounter = 0;
        //update_score();
        config_interval_timer(TIMER_OFF);
        clearScreenVsync(2);

        while (gameStatus == GAME_OVER)
        {
            displayGameOver(85, 50);
			write_game_over(WRITE_TEXT);
            wait_for_vsync();                           // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
        }

        score = 0;
		update_score();
		write_game_over(CLEAR_TEXT);
        clearScreenVsync(2);
    }
}

