void wait_for_vsync()
{
    volatile int *pixel_ctrl_ptr = (int *)0xff203020;
    int status;

    *pixel_ctrl_ptr = 1;
    status = *(pixel_ctrl_ptr + 3);

    while ((status & 0x01) != 0)
    {
        status = *(pixel_ctrl_ptr + 3);
    }
}

void clear_screen()
{
    int i;
    for (i = 0; i < RESOLUTION_Y; i++)
    {
        int j;
        for (j = 0; j < RESOLUTION_X; j++)
        {
            plot_pixel(j, i, BACKGROUND);
        }
    }
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void draw_line(int x0, int y0, int x1, int y1, short int line_color)
{
    int is_steep = FALSE;
    int temp;

    // if the line is too steep, we draw line wrt y-axis
    if (ABS(y1 - y0) > ABS(x1 - x0))
    {
        is_steep = TRUE;

        temp = x1;
        x1 = y1;
        y1 = temp;

        temp = y0;
        y0 = x0;
        x0 = temp;
    }

    // to ensure we are drawing from left to right
    if (x0 > x1)
    {
        temp = x1;
        x1 = x0;
        x0 = temp;

        temp = y1;
        y1 = y0;
        y0 = temp;
    }

    int deltax = x1 - x0;
    int deltay = abs(y1 - y0);
    int error = -(deltax / 2);
    int y = y0;

    int y_step = -1;
    if (y0 < y1)
        y_step = 1;

    int i;
    for (i = x0; i <= x1; i++)
    { // for loop that renders the line

        if (is_steep == TRUE)
            plot_pixel(y, i, line_color); // drawing wrt y-axis
        else
            plot_pixel(i, y, line_color); // drawing wrt x-axis

        error = error + deltay;

        if (error > 0)
        {
            y = y + y_step;
            error = error - deltax;
        }
    }
}

