void config_keyboard()
{                         // interrupt code = 79
    *ps2_control_ptr = 1; // setting RE bit = 1, enabling interrupts
    // printf("%#010x\n", *ps2_control_ptr); // debug
}

/* setup the interval timer interrupts in the FPGA */
void config_interval_timer(timer_status)
{
    volatile int *interval_timer_ptr = (int *)0xFF202000; // interal timer base address

    if (timer_status == TIMER_OFF)
    {
        *(interval_timer_ptr + 1) = 0xB; // STOP = 1, START = 0, CONT = 1, ITO = 1 }
    }

    else if (timer_status == TIMER_ON)
    {
        /* set the interval timer period for scrolling the HEX displays */
        int counter = 1000000000; // 10 seconds in cpulator
        *(interval_timer_ptr + 0x2) = (counter & 0xFFFF);
        *(interval_timer_ptr + 0x3) = (counter >> 16) & 0xFFFF;

        /* start interval timer, enable its interrupts */
        // at address 0xff202004 since 1 in decimal is 4 bytes (1 word = 4 bytes)
        *(interval_timer_ptr + 1) = 0x7; // STOP = 0, START = 1, CONT = 1, ITO = 1 }
    }
}

void set_A9_IRQ_stack(void)
{
    *(LEDR_ptr) = 0; // light up the red li
    int stack, mode;
    stack = 0xFFFFFFFF - 7; // top of A9 on-chip memory, aligned to 8 bytes
    /* change processor to IRQ mode with interrupts disabled */
    mode = 0b11010010;
    asm("msr cpsr, %[ps]"
        :
        : [ps] "r"(mode));
    /* set banked stack pointer */
    asm("mov sp, %[ps]"
        :
        : [ps] "r"(stack));
    /* go back to SVC mode before executing subroutine return! */
    mode = 0b11010011;
    asm("msr cpsr, %[ps]"
        :
        : [ps] "r"(mode));
}

void enable_A9_interrupts(void)
{
    int status = 0b01010011;
    asm("msr cpsr, %[ps]"
        :
        : [ps] "r"(status));
}
/* Configure the Generic Interrupt Controller (GIC) */
void config_GIC(void)
{
    config_interrupt(79, 1); // for ps/2 keyboard
    /* configure the HPS timer interrupt */
    *((int *)0xFFFED8C4) = 0x01000000;
    *((int *)0xFFFED118) = 0x00000080;
    /* configure the FPGA interval timer and KEYs interrupts */
    *((int *)0xFFFED848) = 0x00000101;
    *((int *)0xFFFED108) = 0x00000300;
    // Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all priorities
    *((int *)0xFFFEC104) = 0xFFFF;
    // Set CPU Interface Control Register (ICCICR). Enable signaling of interrupts
    *((int *)0xFFFEC100) = 1; // enable = 1
    // Configure the Distributor Control Register (ICDDCR) to send pending interrupts to CPUs
    *((int *)0xFFFED000) = 1; // enable = 1
}

void config_interrupt(int N, int CPU_target)
{
    int reg_offset, index, value, address;

    /* Configure the Interrupt Set-Enable Registers (ICDISERn).
     * reg_offset = (integer_div(N / 32) * 4
     * value = 1 << (N mod 32) */

    reg_offset = (N >> 3) & 0xFFFFFFFC;
    index = N & 0x1F;
    value = 0x1 << index;
    address = 0xFFFED100 + reg_offset;

    /* Now that we know the register address and value, set the appropriate bit */ *(int *)address |= value;
    *(int *)address |= value;

    /* Configure the Interrupt Processor Targets Register (ICDIPTRn)
     * reg_offset = integer_div(N / 4) * 4
     * index = N mod 4 */

    reg_offset = (N & 0xFFFFFFFC);
    index = N & 0x3;
    address = 0xFFFED800 + reg_offset + index;

    /* Now that we know the register address and value, write to (only) the appropriate byte */
    *(char *)address = (char)CPU_target;
}

void config_KEYs()
{
    volatile int *KEY_ptr = (int *)0xFF200050; // pushbutton KEY address
    *(KEY_ptr + 2) = 0xF;                      // enable interrupts for all four KEYs
}

