{
    while (1)
        ;
}
void __attribute__((interrupt)) __cs3_isr_dabort(void)
{
    while (1)
        ;
}
void __attribute__((interrupt)) __cs3_isr_fiq(void)
{
    while (1)
        ;
}

int f0_prior = 0;
void keyboard_ISR()
{
    hammer_prev_x = hammer_x;
    hammer_prev_y = hammer_y;
    unsigned char byte1 = 0;
    unsigned char byte2 = 0;
    unsigned char byte3 = 0;
    int PS2_DATA, RVALID;

    PS2_DATA = *(ps2_data_ptr);   // read the Data register in the PS/2 port
    RVALID = (PS2_DATA & 0x8000); // extract the RVALID field (starting from 0x8000 = bit 15 of PS2 Data register)

    // When RVALID = 1, this means something is in the data field.
    // Reading from PS2_DATA decrements this field by 1.

    if (RVALID != 0)
    {
        // save the last three bytes received
        byte1 = byte2;
        byte2 = byte3;
        byte3 = PS2_DATA & 0xFF;
        //printf("%#010x\n", byte3); // debug

        if (gameStatus == GAME_RUNNING)
        {
            if (f0_prior == 1)
            {
                f0_prior = 0;
                return;
            }
            else if (byte3 == 0xf0)
            {
                f0_prior = 1;
            }

            if (byte3 == 0x1C)
            { // 'A' key = LEFT
                if (hammer_x - 10 > 0)
                    hammer_x -= 10;
            }
            else if (byte3 == 0x23)
            { // 'D' key = RIGHT
                if (hammer_x + 10 < RESOLUTION_X - 15)
                    hammer_x += 10;
            }
            else if (byte3 == 0x1D)
            { // 'W' key = UP
                if (hammer_y - 10 > 0)
                    hammer_y -= 10;
            }
            else if (byte3 == 0x1B)
            { // 'S' key = DOWN
                if (hammer_y + 10 < RESOLUTION_Y - 30)
                    hammer_y += 10;
            }
        }

        if (byte3 == 0x29)
        { // spacebar for HIT
            if (gameStatus == GAME_START_MENU)
            {
                gameStatus = GAME_RUNNING;
            }
            else if (show && gameStatus == GAME_RUNNING)
            {
                check_hit();
            }
        }

        else if (byte3 == 0x2D)
        { // 'R' key = RESET
            if (gameStatus == GAME_OVER)
            {
                gameStatus = GAME_START_MENU;
            }
        }
    }

    if (show && gameStatus == GAME_RUNNING)
    {
        update_screen();
        wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
        update_screen();
        wait_for_vsync(); 
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
        update_screen();
        wait_for_vsync(); 
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    }
}

// start of main program
extern volatile int key_pressed;
void pushbutton_ISR(void)
{
    volatile int *KEY_ptr = (int *)0xFF200050;
    int press;
    press = *(KEY_ptr + 3);// read the pushbutton interrupt register
    *(KEY_ptr + 3) = press; // clear the interrupt
    hammer_prev_x = hammer_x;
    hammer_prev_y = hammer_y;
    if (press & 0x1)
    { // KEY0
        key_pressed = 0;
        if (hammer_x + 10 < RESOLUTION_X - 15)
            hammer_x += 10;
    }
    else if (press & 0x2)
    { // KEY1
        if (hammer_y - 10 > 0)
            hammer_y -= 10;
    }
    else if (press & 0x4)
    { // KEY2
        if (hammer_y + 10 < RESOLUTION_Y - 30)
            hammer_y += 10;
    }
    else
    { // press & 0x8, which is KEY3
        if (hammer_x - 10 > 0)
            hammer_x -= 10;
    }

    return;
}

