void interval_timer_ISR()
{
    //printf("in interval_timer_ISR\n");
    gameCounter++;
    volatile int *interval_timer_ptr = (int *)0xFF202000; // Intel timer address
    volatile int *slider_switch_ptr = (int *)0xFF200040;  // SW base address
    volatile int *HEX3_HEX0_ptr = (int *)0xFF200020;      // HEX3_HEX0 address
    *(interval_timer_ptr) = 0;                            // clear the interrupt
                                                          //*(HEX3_HEX0_ptr) = pattern;

    volatile int *LEDR_ptr = (int *)0xFF200000;
    test_counter += 1;

    for (i = 0; i < numMoles; i++)
    {
        mole_arr[i].displayed = rand() % 2;
    }

    return;
}

void write(int x, int y, char *text_ptr)
{
    int offset;
    /* Display a null-terminated text string at coordinates x, y. Assume that the text fits on one line */
    offset = (y << 7) + (x << 1);

    while (*(text_ptr))
    {
        *((char *)0xC9000000 + offset) = *(text_ptr); // write to the character buffer
        ++text_ptr;
        ++offset;
    }
}

void update_screen()
{
    VGA_box(hammer_prev_x, hammer_prev_y, hammer_prev_x + 14, hammer_prev_y + 14, GREEN);
    VGA_box(hammer_prev_x + 5, hammer_prev_y + 15, hammer_prev_x + 9, hammer_prev_y + 25, GREEN);

    for (i = 0; i < numMoles; i++)
    {
        VGA_box(mole_arr[i].x_prev_loc - 2, mole_arr[i].y_prev_loc - 2, mole_arr[i].x_prev_loc + 18, mole_arr[i].y_prev_loc + 18, GREEN);
        mole_arr[i].x_prev_loc = mole_arr[i].x_loc;
        mole_arr[i].y_prev_loc = mole_arr[i].y_loc; // VGA_box(mole_arr[i].x_prev_loc  , mole_arr[i].y_prev_loc  , mole_arr[i].x_prev_loc + 10, mole_arr[i].y_prev_loc + 10, GREEN);
        /*if(mole_arr[i].displayed == FALSE){
            VGA_box(mole_arr[i].x_loc, mole_arr[i].y_loc, mole_arr[i].x_loc + 10, mole_arr[i].y_loc + 10, GREEN);
        }*/
    }
    // check boudnary
    for (i = 0; i < numMoles; i++)
    {

        if (!on_board(mole_arr[i].x_loc, mole_arr[i].y_loc))
        {
            mole_arr[i].direction_x = ((rand() % 2) * 2) - 1;
            mole_arr[i].direction_y = ((rand() % 2) * 2) - 1;

            srand(time(0)); // ensuring random numbers
            while (!on_board(mole_arr[i].x_loc + mole_arr[i].direction_x, mole_arr[i].y_loc + mole_arr[i].direction_y))
            {
                // srand(time(0)); //ensuring random numbers
                mole_arr[i].direction_x = ((rand() % 2) * 2) - 1;
                mole_arr[i].direction_y = ((rand() % 2) * 2) - 1;
                //printf("%d, %d ", mole_arr[i].x_loc, mole_arr[i].y_loc);
            }
        }
    }

    // draw moles
    for (i = 0; i < numMoles; i++)
    {

        if (mole_arr[i].displayed == FALSE)
        {
            mole_arr[i].x_loc += mole_arr[i].direction_x;
            mole_arr[i].y_loc += mole_arr[i].direction_y;
            VGA_box(mole_arr[i].x_loc - 1, mole_arr[i].y_loc - 1, mole_arr[i].x_loc + 16, mole_arr[i].y_loc + 16, GREEN);
        }
    }

    for (i = 0; i < numMoles; i++)
    {

        if (mole_arr[i].displayed == TRUE)
        {
            mole_arr[i].x_loc += mole_arr[i].direction_x;
            mole_arr[i].y_loc += mole_arr[i].direction_y;
            drawMole(mole_arr[i].x_loc, mole_arr[i].y_loc, mole_arr[i].x_loc + 10, mole_arr[i].y_loc + 10, PINK);
        }
    }
    // draw hammer
    VGA_box(hammer_x, hammer_y, hammer_x + 14, hammer_y + 14, GREY);
    VGA_box(hammer_x + 5, hammer_y + 15, hammer_x + 9, hammer_y + 25, MAGENTA);
    if (move_count > 1000)
    {
        move_count = 0;
    }
    move_count += 1;
}

void drawMole(int x1, int y1, int x2, int y2, short int pixel_color)

{
    int row, col;

    /* assume that the box coordinates are valid */
    for (row = x1; row <= x1 + 15; row++)
    {
        for (col = y1; col <= y1 + 15; ++col)
        {
            if (moleDraw[col - y1][row - x1] != GREEN)
            {
                plot_pixel(row, col, moleDraw[col - y1][row - x1]);
            }
        }
    }
}

void clearScreenVsync(int iterations)
{
    for (int i = 0; i < iterations; i++)
    {
        clear_screen();
        wait_for_vsync();                           // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    }
}

